const IndexCofees = () => {
    const list = () => {
        fetch("https://mycoffees.herokuapp.com/products", {
            method: "post",
            headers: {
                "Content-Type": "application/json",
            }
        }).then((response) => { return (response.json()) })
            .then((response) => console.log(response))
    }

    return (
        <>
            <button onClick={list}></button>
        </>
    )
}

export default IndexCofees
